import React from "react";
// Make Header Component
export default function Navbar() {
  return (
    <nav className="navbar">
      <img src={require("../react-logo.png")} alt="react-logo" />
      <h3>ReactJS</h3>
      <h4>React-Project-1</h4>
    </nav>
  );
}
